export default function App() {
  return (
    <View style={styles.container}>

      <Image style={styles.pic} source={{uri:'https://i.dlpng.com/static/png/5413848-panthers-logo-png-for-kids-logo-black-panthers-thonon-panthers-png-820_715_preview.png'}}/>
